import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import FirstComponent from "./components/FirstComponent";
import TitleComponent from "./components/TitleComponent";
import StateButton from "./components/StateEventHandlerComponent";
import InputComponent from "./components/InputComponent";

export default function App() {
  return (
      /*Her har vi et et View med klasse navnet container og der er en enkel render View*/
      <View style={styles.container}>
          <Text><h2>Øvelse 2 - State, events, props og references</h2></Text>

          <StatusBar style="auto" />

          <FirstComponent style={{paddingTop:10}}/>

          <TitleComponent title = 'Første title' style={{paddingTop:10}}/>

          <TitleComponent title = 'Anden title' style={{paddingTop:10}}/>

          <StateButton style={{paddingTop:10}}/>

          <InputComponent />

      </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
    component:{
      paddingTop:10
    }

});
